(0xfeb536025cb04903a852951ca73fd0c7, 'TextField', '<text lang=\"fr\">Ce portfolio de dÃ©monstration est un portfolio vide crÃ©Ã© avec Karuta afin de donner une petite idÃ©e des possibilitÃ©s de l\'outil, plutÃ´t que de commencer avec une page vierge.&lt;br&gt;&lt;br&gt;Ce texte et les couleurs de fond, de typographie sont personnalisables. Vous pouvez vous aussi rajouter des blocs.&lt;br&gt;&lt;br&gt;&lt;br&gt;</text><text lang=\"en\">Karuta is free software that lets you build portfolios for universities, schools, and organizations.&lt;br&gt;&lt;br&gt;Karuta allows you to build your own portfolio process and edit portfolio structures as you wish.&lt;br&gt;</text><lastmodified>27/4/2016 15:29:09</lastmodified>', 1, 1, '2016-07-18 18:22:42'),
