(0xf0f8b55112054611b7b609f6b264673e, 'TextField', '<text lang=\"fr\">Karuta est un logiciel Open Source qui permet de crÃ©er des ePortfolios. Vous bÃ¢tissez votre propre modÃ¨le de portfolio.&lt;br&gt;&lt;br&gt;</text><text lang=\"en\">This portfolio has been built to give you an idea of the software\'s possibilities.&lt;br&gt;&lt;br&gt;The content of this page, the menu, the fonts, and the background colors can be edited.&lt;br&gt;&lt;br&gt;Just do it!&lt;br&gt;</text><lastmodified>28/4/2016 12:16:53</lastmodified>', 1, 1, '2016-07-18 18:22:42'),
